interface PredictionResult {
  fpId: string
  signalId: string
  linkerId: string
  fusionProtein: string
  stabilityScore: number
  linker: string
  signal: string
}

interface DirectedEvolutionResult {
  variantId: string
  predScore: string
  mutationSite: string
  primarySeq: string
  variantSeq: string
}

interface DynamicPredictionResult {
  dfpId: string
  linkerId: string
  fusionProtein: string
  stabilityScore: number
  linker: string
}

